tables.table_schema:
CREATE TABLE ab_testing_marketing_creatives (
    id INT,
    strategy_name TEXT,
    creative_name TEXT,
    conversion_rate DECIMAL
);

CREATE TABLE marketing_strategies (
    id INT PRIMARY KEY,
    strategy_name VARCHAR(50),
    start_date DATE,
    end_date DATE
);

CREATE TABLE marketing_strategies (
   strategy_id INT PRIMARY KEY,
   strategy_name VARCHAR(255) NOT NULL,
   strategy_description TEXT
);

CREATE TABLE creatives (
   creative_id INT PRIMARY KEY,
   creative_name VARCHAR(255) NOT NULL,
   creative_type VARCHAR(50),
   creation_date TIMESTAMP
);

CREATE TABLE Strategy_A (
  strategy_id INT PRIMARY KEY,
  strategy_name VARCHAR(50),
  start_date DATE,
  end_date DATE
);

CREATE TABLE Creative_A (
  creative_id INT PRIMARY KEY,
  creative_name VARCHAR(50),
  creation_date DATE,
  creative_description TEXT
);

CREATE TABLE Test_Participants (
  participant_id INT PRIMARY KEY,
  test_id INT,
  participant_name VARCHAR(50),
  group_id INT
);
